import './Home.css';
import { Outlet, Link } from "react-router-dom";

const Home = () => {
    return(
    <>
    
    
    <div class="maintext"><h1>Your one-stop shop for all your academic needs</h1>
    <h3>Knobull is a ready-to-go environment for learning guidance. Our mission is to move academic and career success forward with brave, productive collaboration.</h3></div>
    <Link to="/preq">
     <button type="button">
          I'm in!
     </button>
    </Link>
    
    
    
    </>
    );
  };
  
  export default Home;
